import React from 'react';
import {Switch, Route} from 'react-router';
import './App.css';
// import Form from './components/Form';
import Homepage from './pages/Homepage';

function App() {
  return (
    <div className="App">
      <Switch>
        <Route to = "" component = {Homepage} />
      </Switch>
    </div>
  );
}

export default App;
